import React, { Component,Suspense, lazy } from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';

import Spinner from '../app/shared/Spinner';
import Taxgroup from './inventory/Taxgroup';
import Locator from './inventory/Locator';
import OrganizationPage from './administrator/OrganizationPage';

const Dashboard = lazy(() => import('./dashboard/Dashboard'));
const CustomerPage=lazy(()=> import('./sales/CustomerPage'));
const OrgPage=lazy(()=> import('./administrator/OrganizationPage'));
const LeadForm=lazy(()=> import('./panelone/LeadForm'));
const Order=lazy(()=> import('./panelone/Order'));
const Quote=lazy(()=> import('./panelone/Quote'));
const Supplier=lazy(()=> import('./purchase/Supplier'));
const ProductMaster= lazy(() => import('./inventory/ProductMaster'));
const UOMPage = lazy(() => import('./inventory/UOMPage'));
const Payment= lazy(() => import('./inventory/PaymentTerms'));
const Location = lazy(() => import('./inventory/LocationPage'));
const Warehouse = lazy(() => import('./inventory/WarehousePage'));
const CurrencyPage = lazy(() => import('./inventory/CurrencyPage'));
const TaxComp = lazy(() => import('./inventory/TaxComponent'));
const Taxgrp = lazy(() => import('./inventory/Taxgroup'));
const Loca= lazy(() => import('./inventory/Locator'));
const Despatch = lazy(() => import('./inventory/DespatchMode'));



class AppRoutes extends Component {
  render () {
    return (
      <Suspense fallback={<Spinner/>}>
        <Switch>
          <Route exact path="/dashboard" component={ Dashboard } />
          <Route path="/sales/CustomerPage" component={CustomerPage}/>
          <Route  path="/panelone/LeadForm" component={LeadForm}/>
          <Route path="/panelone/Order" component={Order} />
          <Route path="/panelone/Quote" component={Quote}/>
           <Route path="/purchase/Supplier" component={Supplier}/>
          <Route path="/inventory/ProductMaster" component={ProductMaster} />
          <Route path="/inventory/UOMPage" component={UOMPage} />
          <Route path="/inventory/PaymentTerms" component={Payment} />
          <Route path="/inventory/LocationPage" component={Location} />
          <Route path="/inventory/WarehousePage" component={Warehouse} />
          <Route path="/inventory/Taxgroup" component={Taxgrp} />
          <Route path="/inventory/CurrencyPage" component={CurrencyPage} />
          <Route path="/inventory/Locator" component={Loca} />
          <Route path="/inventory/TaxComponent" component={TaxComp} />
          <Route path="/inventory/DespatchMode" component={Despatch} />
          <Route path="/administrator/OrganizationPage" component={OrgPage}/>
          <Redirect to="/dashboard" />
        </Switch>
      </Suspense>
    );
  }
}

export default AppRoutes;
